import PageWrapper from "../components/PageWrapper";

const projects = [
  {
    title: "Telegram Bot + Google Sheets",
    description:
      "A Telegram bot with dynamic menus, integrated with Google Sheets.",
    link: "https://github.com/yourusername/telegram-bot",
  },
  {
    title: "Personal Portfolio Website",
    description:
      "This portfolio site built with React + Tailwind + Framer Motion.",
    link: "https://github.com/yourusername/portfolio",
  },
  {
    title: "Weather App",
    description:
      "A weather app using OpenWeatherMap API, React, and responsive design.",
    link: "https://github.com/yourusername/weather-app",
  },
];

export default function Projects() {
  return (
    <PageWrapper>
      <section className="min-h-screen bg-gray-100 py-16 px-6 md:px-20">
        <h2 className="text-3xl font-bold text-center text-blue-600 mb-12">
          My Projects
        </h2>
        <div className="grid gap-8 md:grid-cols-2 lg:grid-cols-3">
          {projects.map((project, index) => (
            <div
              key={index}
              className="bg-white p-6 rounded-lg shadow-md border border-gray-200 hover:shadow-xl transition-shadow duration-300"
            >
              <h3 className="text-xl font-semibold mb-2">{project.title}</h3>
              <p className="text-gray-600 mb-4">{project.description}</p>
              <a
                href={project.link}
                target="_blank"
                rel="noreferrer"
                className="text-blue-500 hover:underline"
              >
                View on GitHub â†’
              </a>
            </div>
          ))}
        </div>
      </section>
    </PageWrapper>
  );
}
